import styled from "styled-components";

export const ProfileWrapper = styled.div`

    .container{
        display: flex;
        justify-content: center;
    }

    .card{
        border: dashed 1px black;
        margin: 100px;
        width: 720px;
        height: 780px;
    }

    .username{
        margin-top: 50px;
    }

    .post-container{
        border: dashed 1px black;
        margin-top: 10px;
        height: 630px;
        display: grid;
        grid-template-columns: 240px 240px 240px;
        grid-template-rows: 250px 250px 250px;
    }

    .posts{
        place-self: center;
        font-size: 50px;

    }

    .image{
        height: 250px;
        width: 230px;
    }
`;
